(window.webpackJsonp=window.webpackJsonp||[]).push([[44],{"+t8m":function(e){e.exports=[{id:1,type:"  grafana_alert_notification",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> The name of the alert notification channel.\n",elementType:"li",listDepth:1},{name:"type",description:"<strong>(Required)</strong> The type of the alert notification channel.\n",elementType:"li",listDepth:1},{name:"is_default",description:"<strong>(Optional)</strong> Is this the default channel for all your alerts.\n",elementType:"li",listDepth:1},{name:"settings",description:'<strong>(Optional)</strong> Additional settings, for full reference lookup <a href="http://docs.grafana.org/http_api/alerting">Grafana HTTP API documentation</a>.\n',elementType:"li",listDepth:1},{name:"",description:'<p><strong>Note:</strong> In <code>settings</code> the strings <code>"true"</code> and <code>"false"</code> are mapped to boolean <code>true</code> and <code>false</code> when sent to Grafana.</p>',elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/grafana/r/alert_notification.html",docType:""},{id:2,type:"  grafana_dashboard",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"config_json",description:"<strong>(Required)</strong> The JSON configuration for the dashboard.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/grafana/r/dashboard.html",docType:""},{id:3,type:"  grafana_data_source",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> The data source type. Must be one of the data source\nkeywords supported by the Grafana server.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the data source within the Grafana\nserver.</p>\n</li>',elementType:"li",listDepth:1},{name:"url",description:'<li><p><a name="url"></a><a href="#url"><code>url</code></a> - <strong>(Optional)</strong> The URL for the data source. The type of URL required\nvaries depending on the chosen data source type.</p>\n</li>',elementType:"li",listDepth:1},{name:"is_default",description:'<li><p><a name="is_default"></a><a href="#is_default"><code>is_default</code></a> - <strong>(Optional)</strong> If true, the data source will be the default\nsource used by the Grafana server. Only one data source on a server can be\nthe default.</p>\n</li>',elementType:"li",listDepth:1},{name:"basic_auth_enabled",description:'<li><p><a name="basic_auth_enabled"></a><a href="#basic_auth_enabled"><code>basic_auth_enabled</code></a> - <strong>(Optional)</strong> - If true, HTTP basic authentication will\nbe used to make requests.</p>\n</li>',elementType:"li",listDepth:1},{name:"basic_auth_username",description:'<li><p><a name="basic_auth_username"></a><a href="#basic_auth_username"><code>basic_auth_username</code></a> - (Required if <code>basic_auth_enabled</code> is true) The\nusername to use for basic auth.</p>\n</li>',elementType:"li",listDepth:1},{name:"basic_auth_password",description:'<li><p><a name="basic_auth_password"></a><a href="#basic_auth_password"><code>basic_auth_password</code></a> - (Required if <code>basic_auth_enabled</code> is true) The\npassword to use for basic auth.</p>\n</li>',elementType:"li",listDepth:1},{name:"username",description:'<li><p><a name="username"></a><a href="#username"><code>username</code></a> - (Required by some data source types) The username to use to\nauthenticate to the data source.</p>\n</li>',elementType:"li",listDepth:1},{name:"password",description:'<li><p><a name="password"></a><a href="#password"><code>password</code></a> - (Required by some data source types) The password to use to\nauthenticate to the data source.</p>\n</li>',elementType:"li",listDepth:1},{name:"json_data",description:'<li><p><a name="json_data"></a><a href="#json_data"><code>json_data</code></a> - (Required by some data source types) The default region\nand authentication type to access the data source. <code>json_data</code> is documented\nin more detail below.</p>\n</li>',elementType:"li",listDepth:1},{name:"secure_json_data",description:'<li><p><a name="secure_json_data"></a><a href="#secure_json_data"><code>secure_json_data</code></a> - (Required by some data source types) The access and\nsecret keys required to access the data source. <code>secure_json_data</code> is\ndocumented in more detail below.</p>\n</li>',elementType:"li",listDepth:1},{name:"database_name",description:'<li><p><a name="database_name"></a><a href="#database_name"><code>database_name</code></a> - (Required by some data source types) The name of the\ndatabase to use on the selected data source server.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_mode",description:'<li><p><a name="access_mode"></a><a href="#access_mode"><code>access_mode</code></a> - <strong>(Optional)</strong> The method by which the browser-based Grafana\napplication will access the data source. The default is "proxy", which means\nthat the application will make requests via a proxy endpoint on the Grafana\nserver.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>JSON Data (<code>json_data</code>) supports the following:</p>",elementType:"p"},{name:"auth_type",description:'<li><p><a name="auth_type"></a><a href="#auth_type"><code>auth_type</code></a> - (Required by some data source types) The authentication type\ntype used to access the data source.</p>\n</li>',elementType:"li",listDepth:1},{name:"default",description:'<li><p><a name="default"></a><a href="#default"><code>default</code></a> - (Required by some data source types) The default region for\nthe data source.</p>\n</li>',elementType:"li",listDepth:1},{name:"custom_metrics_namespaces",description:'<li><p><a name="custom_metrics_namespaces"></a><a href="#custom_metrics_namespaces"><code>custom_metrics_namespaces</code></a> - (Optional, for the CloudWatch data source type)\nA comma-separated list of custom namespaces to be queried by the CloudWatch\ndata source.</p>\n</li>',elementType:"li",listDepth:1},{name:"assume_role_arn",description:'<li><p><a name="assume_role_arn"></a><a href="#assume_role_arn"><code>assume_role_arn</code></a> - (Optional, for the CloudWatch data source type) The role\nARN to be assumed by Grafana when using the CloudWatch data source.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>Secure JSON Data (<code>secure_json_data</code>) supports the following:</p>",elementType:"p"},{name:"access_key",description:'<li><p><a name="access_key"></a><a href="#access_key"><code>access_key</code></a> - (Required by some data source types) The access key required\nto access the data source.</p>\n</li>',elementType:"li",listDepth:1},{name:"secret_key",description:'<li><p><a name="secret_key"></a><a href="#secret_key"><code>secret_key</code></a> - (Required by some data source types) The secret key required\nto access the data source.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/grafana/r/data_source.html",docType:""},{id:4,type:"  grafana_folder",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"title",description:"<strong>(Required)</strong> The title of the folder.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/grafana/r/folder.html",docType:""},{id:5,type:"  grafana_organization",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The display name for the Grafana organization created.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_user",description:'<li><p><a name="admin_user"></a><a href="#admin_user"><code>admin_user</code></a> - <strong>(Optional)</strong> The login name of the configured\n<a href="http://docs.grafana.org/installation/configuration/#admin-user">default admin user</a>\nfor the Grafana installation. If unset, this value defaults to <code>admin</code>, the\nGrafana default. Grafana adds the default admin user to all organizations\nautomatically upon creation, and this parameter keeps Terraform from removing\nit from organizations.</p>\n</li>',elementType:"li",listDepth:1},{name:"create_users",description:'<li><p><a name="create_users"></a><a href="#create_users"><code>create_users</code></a> - <strong>(Optional)</strong> Whether or not to create Grafana users specified\nin the organization\'s membership if they don\'t already exist in Grafana. If\nunspecified, this parameter defaults to <code>true</code>, creating placeholder users\nwith the <code>name</code>, <code>login</code>, and <code>email</code> set to the email of the user, and a\nrandom password. Setting this option to <code>false</code> will cause an error to be\nthrown for any users that do not already exist in Grafana.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:'<p>This option is particularly useful when integrating Grafana with external\n  authentication services such as\n  <a href="http://docs.grafana.org/installation/configuration/#auth-github"><code>auth.github</code></a>\n  and\n  <a href="http://docs.grafana.org/installation/configuration/#auth-google"><code>auth.google</code></a>.</p>',elementType:"p"},{name:"admins",description:'<li><p><a name="admins"></a><a href="#admins"><code>admins</code></a> - <strong>(Optional)</strong> A list of email addresses corresponding to users who\nshould be given <code>admin</code> access to the organization. Note: users specified\nhere must already exist in Grafana unless \'create_users\' is set to true.</p>\n</li>',elementType:"li",listDepth:1},{name:"editors",description:'<li><p><a name="editors"></a><a href="#editors"><code>editors</code></a> - <strong>(Optional)</strong> A list of email addresses corresponding to users who\nshould be given <code>editor</code> access to the organization. Note: users specified\nhere must already exist in Grafana unless \'create_users\' is set to true.</p>\n</li>',elementType:"li",listDepth:1},{name:"viewers",description:'<li><p><a name="viewers"></a><a href="#viewers"><code>viewers</code></a> - <strong>(Optional)</strong> A list of email addresses corresponding to users who\nshould be given <code>viewer</code> access to the organization. Note: users specified\nhere must already exist in Grafana unless \'create_users\' is set to true.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>A user can only be listed under one role-group for an organization, listing the\nsame user under multiple roles will cause an error to be thrown.</p>",elementType:"p"},{name:"",description:"<p>Note - Users specified for each role-group (<code>admins</code>, <code>editors</code>, <code>viewers</code>)\nshould be listed in ascending alphabetical order (A-Z). By defining users in\nalphabetical order, Terraform is prevented from detecting unnecessary changes\nwhen comparing the list of defined users in the resource to the (ordered) list\nreturned by the Grafana API.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/grafana/r/organization.html",docType:""}]}}]);